import React from 'react'
import Accordion from 'react-bootstrap/Accordion';

function Todo(props:any) {
  return (
    <Accordion.Item>
        <input type="checkbox"></input>
        <label>{props.name}</label>
        <div>
            <input type="text"></input>
        <button>Add Subtask</button>
        </div>
    </Accordion.Item>
  )
}

export default Todo
